import logo from './logo.svg';
import './App.css';
import UserLogin from './components/Login/UserLogin';
import { BrowserRouter, Routes, Route, Link, Navigate } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Box sx={{ flexGrow: 1 }}>
        <AppBar position="static">
          <Toolbar>
            <Typography variant="h7"  sx={{ flexGrow: 1}}>
              <Link to="/" style={{color:"white",paddingRight:"1rem"}}>Home</Link>
              <Link to="/Grammerly" style={{color:"white",paddingRight:"1rem"}}>Grammerly</Link>
              <Link to="/products" style={{color:"white",paddingRight:"1rem"}}>AboutUs</Link>
              <Link to="/API" style={{color:"white",paddingRight:"1rem"}}>API Testing</Link>
              <Link to="/AlertTest" style={{color:"white",paddingRight:"1rem"}}>AlertTest</Link>
              <Link to="/Login" style={{color:"white",paddingRight:"1rem"}}>Login</Link>
            </Typography>
          </Toolbar>
        </AppBar>
      </Box>
      <Routes>
        <Route path="/" element={<LandingPage />} />
        <Route path="/Grammerly" element={<Grammerly />} />
        <Route path="/API" element={<LinksComponent />} />
        <Route path="/AlertTest"  element={<AlertTest />} />
        <Route path="/Login"  element={<LoginPage />}  />
        {/* if no route will found new Page will comes  */}
        <Route path="*" element={<PageNotFound />} />
      </Routes>
    </BrowserRouter>



  );
}

export default App;
